var Montage = require("montage").Montage,
    Template = require("montage/core/template").Template,
    UUID = require("montage/core/uuid"),
    Project;

exports.Project = Project = Montage.create(Montage, {

    init: {
        value: function (url, name, template) {
            this.url = url;
            this.name = name;
            this.template = template;
            return this;
        }
    },

    url: {
        value: null
    },

    name: {
        value: null
    },

    template: {
        value: null
    }

});


exports.ProjectFactory = Montage.create(Montage, {

    templateWithContent: {
        value: function (serialization, bodyMarkup) {
            var mockDocument = document.implementation.createHTMLDocument(),
                serializationNode = mockDocument.createElement("script");

            serializationNode.setAttribute("type", "text/montage-serialization");
            serializationNode.innerHTML = JSON.stringify(serialization);
            mockDocument.getElementsByTagName("head")[0].appendChild(serializationNode);

            mockDocument.getElementsByTagName("body")[0].innerHTML = bodyMarkup;

            return Template.create().initWithDocument(mockDocument, require);
        }
    },

    /**
     * Return a promise for a project
     */
    defaultProject: {
        value: function (name) {
            var defaultSerialization = {
                "star": {
                    "prototype": "matte/ui/image.reel",
                        "properties": {
                        "element": {"#": "image"},
                        "width": 100,
                        "src": "data:image/png;base64,"
                    }
                }
            };

            var defaultBodyMarkup = '<div data-montage-id="owner"><img data-montage-id="image"></div>';

            return this.templateWithContent(defaultSerialization, defaultBodyMarkup)
                .then(function (template) {
                    return Project.create().init("sandy-proj://" + UUID.generate(), name, template);
                });
        }
    }

});
